var title_f25_63_26620="Indic aortic valve replace";
var content_f25_63_26620=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F57704&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F57704&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Indications for aortic valve replacement in aortic stenosis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Class",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Patients with severe AS and any symptoms",
"       </td>",
"       <td>",
"        IB",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Patients with severe AS undergoing coronary artery bypass surgery, surgery of the ascending aorta, or on another valve",
"       </td>",
"       <td>",
"        IC",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Asymptomatic patients with severe AS and systolic LV dysfunction (LVEF &lt;50 percent) unless due to other cause",
"       </td>",
"       <td>",
"        IC",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Asymptomatic patients with severe AS and abnormal exercise test showing symptoms on exercise",
"       </td>",
"       <td>",
"        IC",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Asymptomatic patients with severe AS and abnormal exercise test showing fall in blood pressure below baseline",
"       </td>",
"       <td>",
"        IIaC",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Patients with moderate AS* undergoing coronary artery bypass surgery, surgery of the ascending aorta or another valve",
"       </td>",
"       <td>",
"        IIaC",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Asymptomatic patients with severe AS and moderate-to-severe valve calcification, and a rate of peak velocity progression &ge;0.3 m/s per year",
"       </td>",
"       <td>",
"        IIaC",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        AS with low gradient (&lt;40 mmHg) and LV dysfunction with contractile reserve",
"       </td>",
"       <td>",
"        IIaC",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Asymptomatic patients with severe AS and abnormal exercise test showing complex ventricular arrhythmias",
"       </td>",
"       <td>",
"        IIbC",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Asymptomatic patients with severe AS and excessive LV hypertrophy (&ge;15 mm) unless this is due to hypertension",
"       </td>",
"       <td>",
"        IIbC",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        AS with low gradient (&lt;40 mmHg) and LV dysfunction without contractile reserve",
"       </td>",
"       <td>",
"        IIbC",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     AS: aortic stenosis; EF: ejection fraction; LV: left ventricular.",
"     <br>",
"      * Moderate AS is defined as valve area 1.0 to 1.5 cm",
"      <sup>",
"       2",
"      </sup>",
"      (0.6 cm",
"      <sup>",
"       2",
"      </sup>",
"      /m",
"      <sup>",
"       2",
"      </sup>",
"      to 0.9 cm",
"      <sup>",
"       2",
"      </sup>",
"      /m",
"      <sup>",
"       2",
"      </sup>",
"      BSA) or mean aortic gradient 30 to 50 mmHg in the presence of normal flow conditions. However, clinical judgement is required.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Vahanian A, Baumgartner H, Bax J, et al. Guidelines on the management of valvular heart disease: The Task Force on the Management of Valvular Heart Disease of the European Society of Cardiology. Eur Heart J 2007; 28:230. Copyright &copy; 2007 Oxford University Press.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
